import React from 'react'

export const MainCards = () => {
  return (
    <div className='product'>
        <div className='image'>
            <span className='text'>Texto</span>
            <span className='title'>Titulo</span>
            <span className='price'>$1000</span>
        </div>
    </div>
  )
}
